import React from 'react';
import './App.css';
<App className="css"></App>
import { CssBaseline, Container } from '@mui/material';
import AnalyticsDashboard from './Components/AnalyticsDashboard';

function App() {
    return (
        <Container>
            <CssBaseline />
            <AnalyticsDashboard />
        </Container>
    );
}

export default App;
